import React, { Component } from "react";
import { TwitchPlayer } from "react-twitch-embed";
import './App.css';


class TwitchView extends Component {

  render() {
		const { muted } = this.props;
    return (
      <div>
			  <TwitchPlayer
            channel="ampm_m"
            parent={["codesandbox.io"]}
            hideControls={false}
            muted={muted}
            width={750}
            height={750}

        />
      </div>
    );
  }
}

export default TwitchView;
